import React from 'react'
import { Box, Stack} from '@mui/materal'
import { CircularProgress} from '@mui/icons-material'

function Loader() {
    return (
        <Box minHeight='95vh'>
            <Stack direction='row' justifyContent='center' alignItems='center' height='80vh'>
                <CircularProgress />
            </Stack>
        </Box>
    )
}

export default Loader
